This is the "core", "kernel" or "domain". Is the main business logic unit that is composed by Data , Functions and Procedures and Tests . Data The idea is to rely on inmutable data structures as much as posible, so applications get much easier to maintain and algorithms get much cleaner, achieving harmony between data structures and procedures. Odin gives developers several data structures. Structs, Maps, Enums, Strings, but also procedures that can be data too. Sometimes using procedures as data params can offer tremendous perfomance wins. Example We could store our Square with the data. Square { {5, 0}, {15, 0} {15, 0}, {15, 10} {15, 10}, {5, 10} {5, 10}, {5, 0} } This way works fine, but we could also convert it to a procedure that calculates the values. That way we can avoid passing and coping heavy data in the params. package Data import "core:fmt" Square :: struct { x1, y1, x2, y2, x3, y3, x4, y4 : [2]int
} square :: proc (x: int, y: int, size: int) -> Square { return Square{ {x, y}, {x + size, y}, {x + size, y}, {x + size, y + size}, {x + size, y + size}, {x, y + size}, {x, y + size}, {x, y} }
} main :: proc() { // We can save the procedure in a variable // Or pass the procedure as a param in another procedure // This is passing the pointer my_procedure_pointer := square // Square{x1 = [5, 0], y1 = [15, 0], // x2 = [15, 0], y2 = [15, 10], // x3 = [15, 10], y3 = [5, 10], // x4 = [5, 10], y4 = [5, 0]} fmt.printf("%v", my_procedure_pointer(5, 0, 10))
} We start with a procedure called square. It takes a point (x, y) and a size, and transforms that data to the same square format we saw earlier. Procedures Procedures needs certainty and sanitized data. If you were building an application it would be more of a library. The main concept here is CRC , which means: Constructors, Reducers and Converters. Constructors: Are procedures that creates and sets data structures that will be pased down to Reducers and Converters. This data structure is known as the accumulator or token. Reducers: These procedures take the accumulator and "reduce it", applying a pipeline of different operations and procedures until it reaches a state ready for the Converter. Converter: Takes the accumulator and "convert it" to a final format, that is ready for displaying to the user or pass it to another pipeline of CRC . Example would be a procedure that takes a json data structure and convert it to string, this string will be passed down to the pipeline for saving the contents to a file in disk. Thanks to this form of organization, we can see our code in a coherent and unified way. By having a common data structure with several functions, we can perform operations and express ourselves with greater readability. Our systems will be easier to understand and maintain in the future. Consistency is an important quality factor in our systems and using CRC is a great tool to achieve that. Example Odin uses packages, procedures and data types, which allows a way to organize our code in what is called CRCs (Constructors, Reducers, and Converters). So we will have procedures to (create) an accumulator, procedures that will perform operations (reducers) with this accumulator and finally procedures that will transform the accumulator into a final format (converters). This is something that has existed for a long time in different programming languages ‚Äã‚Äãsuch as Haskell or Lisp . The most important thing you can do in a language is to unite ideas using composition. The idea is to create a pipeline that receives an accumulator as its first parameter and performs a series of reduce operations until reaching the final converter. package CRC import "core:fmt" Person :: struct { name : string, age : int
} // Creator
new_person :: proc(name: string, age: int) -> Person { person : Person person.name = name person.age = age return person
} // Reducer
// We use a new structure to avoid mutating the original parameter
rejuvenate_person :: proc(person: Person, years: int) -> Person { return new_person(person.name, person.age - years)
} // Converter, we only show the value we want to.
person_to_string :: proc(person: Person) -> (string, string, int) { return "The person %s, now have %d years", person.name, person.age
} // Pipeline
main :: proc() { person := new_person("Camilo", 35) person = rejuvenate_person(person, 10) out, name, age := person_to_string(person) fmt.printfln(out, name, age) // The person Camilo, now have 25 years
} Example 2 Let's illustrate this a bit using a treasure map. In this map we are going to give a series of directions north, south, east and west. You can see that we have a creation function that returns a Treasure struct {x, y}, which will be our accumulator data structure. Then we have a series of reducers that modify the struct and return a new struct with the appropriate values. Finally we have our converter that returns a String with a final message. package CRC import "core:fmt" Treasure :: struct { x: int, y: int
} // Constructors
new :: proc(x: int, y: int) -> Treasure { treasure : Treasure treasure.x = x treasure.y = y return treasure
} empty :: proc() -> Treasure { return new(0, 0)
} // Reducers
north :: proc(treasure : Treasure) -> Treasure { return new(treasure.x, treasure.y - 1)
} south :: proc(treasure : Treasure) -> Treasure { return new(treasure.x, treasure.y + 1)
} east :: proc(treasure : Treasure) -> Treasure { return new(treasure.x - 1, treasure.y)
} west :: proc(treasure : Treasure) -> Treasure { return new(treasure.x + 1, treasure.y)
} // Converter
show :: proc (treasure : Treasure) -> (string, int, int) { return "The treasure is on the coordinates (%d, %d)", treasure.x, treasure.y
} // Pipeline
main :: proc() { treasure := empty() // (0, 0) treasure = north(treasure) // (0, -1) treasure = north(treasure) // (0, -2) treasure = north(treasure) // (0, -3) treasure = north(treasure) // (0, -4) treasure = west(treasure) // (1, -4) treasure = west(treasure) // (2, -4) treasure = west(treasure) // (3, -4) treasure = south(treasure) // (3, -3) treasure = east(treasure) // (2, -3) treasure = east(treasure) // (1, -3) treasure = east(treasure) // (0, -3) out, x, y := show(treasure) fmt.printfln(out, x, y) // The treasure is on the coordinates (0, -3)
} We can compare these techniques with the Object Oriented pattern of Command - Query Segregation . Bertrand Meyer in his book Object Oriented Software Construction - a book that is one of the most influential OOP books. The fundamental idea is that we should divide an object's methods into two sharply separated categories: Queries: Return a result and do not change the observable state of the system (are free of side effects). Commands: Change the state of a system but do not return a value. Because the term 'command' is widely used in other contexts, is preferred to refer to them as 'modifiers', 'mutators', or in this case reducers. The really valuable idea in this principle is that it's extremely handy if you can clearly separate methods that change state from those that don't. This is because you can use queries in many situations with much more confidence, introducing them anywhere, changing their order. You have to be more careful with modifiers. Tests
